import sys

n = int(sys.stdin.readline().strip())

def is_possible(n):
    if n == 1:
        return True
    elif n % 2 == 0:
        return is_possible(n // 2)
    else:
        return is_possible((n - 1) // 2) and is_possible((n + 1) // 2)

for i in range(1, n + 1):
    if is_possible(i):
        print(i)

